// contact form dynamic
(function($) {
    'use strict';

    // Get the form.
    var form = $('#john-contact-form');

    // Get the messages div.
    var formMessages = $('.contact-send-message');

    // Set up an event listener for the contact form.
    $(form).submit(function(e) {
        // Stop the browser from submitting the form.
        e.preventDefault();

        // Serialize the form data.
        var formData = $(form).serialize();

        // Submit the form using AJAX.
        $.ajax({
                type: 'POST',
                url: $(form).attr('action'),
                data: formData
            })
            .done(function(response) {
                // Make sure that the formMessages div has the 'success' class.
                $(formMessages).removeClass('text-danger');
                $(formMessages).addClass('text-success');

                // Set the message text.
                $(formMessages).text(response);

                // Clear the form.
                $('#john-contact-form form-control').val('');
            })
            .fail(function(data) {
                // Make sure that the formMessages div has the '.text-danger' class.
                $(formMessages).removeClass('text-success');
                $(formMessages).addClass('text-danger');

                // Set the message text.
                if (data.responseText !== '') {
                    $(formMessages).text(data.responseText);
                } else {
                    $(formMessages).text('Oops! An error occurred and your message could not be sent.');
                }
            });
    });

})(jQuery);


//jQuery for page scrolling feature - requires jQuery Easing plugin
$(function() {
    $('.page-scroll').bind('click', function(event) {
        var $anchor = $(this);
        $('html, body').stop().animate({
            scrollTop: $($anchor.attr('href')).offset().top
        });
        event.preventDefault();
    });
});

/* ---------------------------------------------
  jQuery Site Preloaded animation
 --------------------------------------------- */
$(window).on('load', function() {
   $("#john-loader").fadeOut(500);
});

/* ---------------------------------------------
 Header sticky style.
--------------------------------------------- */
$(window).on('scroll', function () {
    var windowSize = $(window).width();
    if (windowSize > 1 && $(this).scrollTop() > 1) {
        $('.sticky-header').addClass('is_sticky');
    }
    else {
        $('.sticky-header').removeClass('is_sticky');
    }
});
$('body').scrollspy({ target: '#ScrollSpy' })

